import React from "react";
import {connect} from 'react-redux';
import Button from '@material-ui/core/Button';
import calculatorActions from '../actions/calculator';

const buttonStyle2 = {
    outline: 'none',
    border: 'none',
    padding: '5%',
    width: 300,
    display: 'flex',
    margin: '2%',
    cursor: 'pointer',
    color: '#fff',
    fontWeight: 500,
    fontSize: '0.9rem',
    height: 62,
    justifyContent: 'center',
    alignItems: 'center',
  };

class Calculator extends React.Component{
    render () {
        console.log(this.props);
        return (
            <div>
                <Button 
                    onClick={() => calculatorActions.fetchExpresions({
                        expressionsCount: 5,
                    })(this.props.dispatch)}
                    style={buttonStyle2}>
                Get and solve expressions
                </Button>
                {this.props.isLoading && (
                    <div>
                        Loading
                    </div>
                )}
                {this.props.isLoading && (
                    <div style={{display: 'flex', flexDirection: 'column'}}>
                        {this.props.list.map(expression => (
                            <div>
                                {expression.name}
                            </div>
                        ))}
                    </div>
                )}

            </div>
        )
    }
}

const mapReduxStateToProps = reduxState => ({
    ...reduxState,    
});

const mapDispatchToProps = dispatch => ({
    dispatch,
});

export default connect(mapReduxStateToProps, mapDispatchToProps)(Calculator);
